import './Home.css'

class AdminDashboard extends React.Component{
    render() {
        return (
            <div>
                <br></br><br></br>
                <h1>Welcome to Admin Dashboard!</h1>
                <br></br><br></br><br></br><br></br><br></br>
                <hr></hr>
                <button>Create Quiz</button>
                <br></br><br></br>
                <h2>Upcoming Quizzes : </h2>
            </div>
        )
    }
}

export default AdminDashboard
